import {
    VView,
    Text,
    Button,
    StyleSheet,
    ScrollView,
    Image
} from "react-native";
import { View } from 'react-native-web';

const Shop1Menu = ({navigation}) => {
    return (
        <ScrollView>
           <View>
               <Text>
                   This is Menu of Shop 1
               </Text>
           </View>
        </ScrollView>
        
        

        
    )
}
export default Shop1Menu;
